sap.ui.define(["sap/ui/core/mvc/Controller"],function(e){"use strict";return e.extend("sp.fiori.supplierform.controller.MessagePage",{onInit:function(){this.router=sap.ui.core.UIComponent.getRouterFor(this);this.router.attachRouteMatched(this.handleRouteMatched,this)},handleRouteMatched:function(e){if(e.getParameter("name")!=="invalidUrl"){return}var t=e.getParameter("arguments").status;if(t==="submit"){this.getView().byId("msgPageId").setText("This form link is already submitted")}}})});